import React from "react";
import { Row, Col } from "antd";
import utilCss from "../styles/app.module.css";

export default function home() {
  return (
    <>
      <Row orientation gutter={{ xs: 8, sm: 16, md: 24, lg: 32 }} className={utilCss.home}>
        <Col className="gutter-row">Home</Col>
        <Col className="gutter-row">Our Food</Col>
        <Col className="gutter-row">Plans</Col>
      </Row>
    </>
  );
}
